import React from 'react';

import { BtnContainer } from './button';
import PlayIcon from '../../images/play.svg';
import PauseIcon from '../../images/pause.svg';

function PlayBtn() {
  return (
    <BtnContainer>
      <img src={PlayIcon} alt="play" />
    </BtnContainer>
  );
}

export default PlayBtn;
